	function tabs($ctx) {
		if (typeof $ctx == 'undefined') {
			$ctx = $('body');
		}

		$('.tabs-block', $ctx).each(function() {
			var $tabs = $('.tabs .tab', this);
			var $tabsContent = $('.tabs-content .tab', this);

			var $active = $tabs.filter('.active');

			if ($active.length) {
				$tabsContent.eq($tabs.index($active)).addClass('active');
			} else {
				$tabs
					.removeClass('active')
					.first()
					.addClass('active');

				$tabsContent
					.removeClass('active')
					.first()
					.addClass('active');
			}

			$tabs.find('a').on('click', function(e) {
				e.preventDefault();
			});

			$tabs.on('click', function(e) {
				e.preventDefault();

				if ($(this).hasClass('active')) return;

				$tabs.removeClass('active');
				$(this).addClass('active');

				$tabsContent.removeClass('active');
				var $tabContent = $tabsContent.eq($tabs.index(this));
				$tabContent.addClass('active');
			});
		});
	}

	function svgs() {
		document.querySelectorAll('img.svg').forEach(function(img) {
			var imgID = img.id;
			var imgClass = img.className;
			var imgStyle = img.style.width;
			var imgURL = img.src;

			fetch(imgURL)
				.then(function(response) {
					return response.text();
				})
				.then(function(text) {
					var parser = new DOMParser();
					var xmlDoc = parser.parseFromString(text, 'text/xml');

					// Get the SVG tag, ignore the rest
					var svg = xmlDoc.getElementsByTagName('svg')[0];

					// Add replaced image's ID to the new SVG
					if (typeof imgID !== 'undefined') {
						svg.setAttribute('id', imgID);
					}
					// Add replaced image's classes to the new SVG
					if (typeof imgClass !== 'undefined') {
						svg.setAttribute('class', imgClass + ' replaced-svg');
					}

					if (typeof imgStyle !== 'undefined') {
						svg.style.width = imgStyle;
					}

					// Remove any invalid XML tags as per http://validator.w3.org
					svg.removeAttribute('xmlns:a');

					// Check if the viewport is set, if the viewport is not set the SVG wont't scale.
					if (!svg.getAttribute('viewBox') && svg.getAttribute('height') && svg.getAttribute('width')) {
						svg.setAttribute(
							'viewBox',
							'0 0 ' + svg.getAttribute('height') + ' ' + svg.getAttribute('width')
						);
					}

					// Replace image with new SVG
					img.parentNode.replaceChild(svg, img);
				});
		});
	}

