	function map() {
		var $mapBlock = $('.map');
		if ($mapBlock.length) {
			new Scheduler(function() {
				var map = new Maps(),
					sch = this;

				map.show($mapBlock);

				map.setFocus($mapBlock.data('coords'));
				map.setZoom(16);

				$('.centers__item')
					.each(function() {
						map.addPoint($(this).data('coords'));
					})
					.on('click', function() {
						map.setFocus($(this).data('coords'));
					});

				this.run();
			});
		}
	}

